import React from 'react'

export default function Cart() {
    return (
// <!--
// This example requires Tailwind CSS v2.0+ 

// This example requires some changes to your config:

// ```
// // tailwind.config.js
// module.exports = {
//   // ...
//   plugins: [
//     // ...
//     require('@tailwindcss/aspect-ratio'),
//   ]
// }
// ```
// -->
<div class="bg-white">
<div class="mx-auto py-12 px-4 max-w-7xl sm:px-6 lg:px-8 lg:py-24">
  <div class="space-y-12 lg:grid lg:grid-cols-3 lg:gap-8 lg:space-y-0">
    <div class="space-y-5 sm:space-y-4">
      <h2 class="text-3xl font-extrabold tracking-tight sm:text-4xl">About Us</h2>
      <p class="text-xl text-gray-500">Nulla quam felis, enim faucibus proin velit, ornare id pretium. Augue ultrices sed arcu condimentum vestibulum suspendisse. Volutpat eu faucibus vivamus eget bibendum cras.</p>
    </div>
    <div class="lg:col-span-2">
      <ul class="space-y-12 sm:divide-y sm:divide-gray-200 sm:space-y-0 sm:-mt-8 lg:gap-x-8 lg:space-y-0">
        <li class="sm:py-8">
          <div class="space-y-4 sm:grid sm:grid-cols-3 sm:items-start sm:gap-6 sm:space-y-0">
            {/* <!-- Image --> */}
            <div class="aspect-w-3 aspect-h-2 sm:aspect-w-3 sm:aspect-h-4">
              <img class="object-cover shadow-lg rounded-lg" src="https://images.unsplash.com/photo-1494790108377-be9c29b29330?ixlib=rb-1.2.1&ixqx=J4TTyWeNKF&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=facearea&facepad=8&w=1024&h=1024&q=80" alt=""/>
            </div>
            <div class="sm:col-span-2">
              <div class="space-y-4">
                <div class="text-lg leading-6 font-medium space-y-1">
                  <h3>Product name</h3>
                  <p class="text-indigo-600">Size</p>
                  <p class="text-indigo-600">Quantity</p>
                </div>
                <div class="text-lg">
                  <p class="text-gray-500">Subtotal</p>
                </div>
              </div>
            </div>
          </div>
        </li>

        {/* <!-- More items... --> */}
      </ul>
    </div>
  </div>
</div>
</div>

    )
}
